text:
O Flamengo sabia:
- que o próximo jogo tem vantagem de 4 gols;
- que o Palmeiras empatou;
- que o Ceará iria jogar na retranca e contra-ataque;
- que precisaria de jogadores habilidosos para furar a defesa do Ceará;
- que no próximo jogo pode poupar;
- que tem o time titular temido;
- que precisava ganhar.
Porque entrou com 7 reservas?
Perdeu interesse pelo Brasileirão?
Está focado onde os prêmios são melhores?
Juntamos todas as forças para ter um time vencedor e sem motivo não colocamos para jogar.
Como torcedor estou sem entender.

 @HaaelzZ  Vai pesquisar antes de falar besteira,
Na libertadores mão sem Querer em lance de ataque não é mais falta,
E contra o São Paulo a bola nem sequer bateu na mão, e mesmo que tivesse batido não seria nada

 @adrirlsilva7756  o burrinho de carga, você disse que não viu nenhum flamenguista contando vitória sobre o Ceará, exceto os comentaristas, certo?
Pois então, eu disse pra você ir ver os comentarios dos flamenguistas nos melhores momentos de palmeiras x bragangino.
Tem certeza que é pra mim que falta interpretação de texto? Acho que não em.

 @maiusorebelo8151  
Vc é goleiro? 

Se Não é então nao fale merda!
